import { Link } from "react-router-dom";
import { useState } from 'react';

import ItemModal from '../ItemModal.js';
import MainNavbar from '../../MainNavbar.js';
import ProductNavbar from '../ProductNavbar.js';

/*Set images URL*/
import armoLipid from '../../../images/products/supplements-heart-health/armolipid.jpg';
import tocoq10 from '../../../images/products/supplements-heart-health/tocoq10-coenzyme.png';

function HeartHealth () {

    const [show, setShow] = useState(false);
    const [name, setName] = useState("");
    const [image, setImage] = useState("");
    const [description, setDescription] = useState("");
    const [packSize, setPackSize] = useState("");
    const [productOf, setProductOf] = useState("");
    const [exclusiveAvailability, setAvailability] = useState(false);
    const [ingredients, setIngredients] = useState("");
    const [dosageInstructions, setDosage] = useState("");

    const header = "Heart health";
    const category = "Supplements / " + header;
    const products = [
        {
            id:1, 
            name:"ArmoLIPID", 
            image: armoLipid,
            description: "Supports healthy cholesterol levels in association with a suitable diet.",
            packSize: "??",
            productOf: "Italy",
            exclusiveAvailability: true,
            ingredients: "Red yeast rice, Policosanol, Folic acid, Coenzyme Q10, Astaxanthin",
            dosageInstructions: "1 tab daily, every evening after dinner",
        },
        {
            id:2, 
            name:"TocoQ10 Coenzyme Q10 (Reduced Form) + Tocotrienols Vegetable Softgels", 
            image: tocoq10,
            description: "Potent anti-oxidants for brain and heart. Improve heart and brain functions. Maintain optimum cholesterol levels",
            packSize: "	60’s vegetable softgels",
            productOf: "-",
            exclusiveAvailability: false,
            ingredients: "Coenzyme Q10 (Ubiquinol) 50mg, Tocotrienols 30mg",
            dosageInstructions: "Take 1 softgel with/after a meal",
        },
    ];

    const productList = products.map((product) =>(

        <div className="col col-sm-4 itemCard" key={product.id}>
            <div className="itemImage">
                <Link href={() => false} onClick={() => displayItemModal(product)}><img src={product.image} alt={product.name}/> </Link>
            </div>
            <div className="itemInfo">
                <Link href={() => false} onClick={() => displayItemModal(product)}><p className="itemName">{product.name}</p> </Link>
                <p className="itemDesc">{category}</p>
            </div>
        </div>

    ));

    /*This is to close the modal and reset the value*/
    function callBack (childData) {
        setShow(false);
    }

    const displayItemModal = (message) => {
        setName(message.name);
        setImage(message.image);
        setDescription(message.description);
        setPackSize(message.packSize);
        setProductOf(message.productOf);
        setAvailability(message.exclusiveAvailability);
        setIngredients(message.ingredients);
        setDosage(message.dosageInstructions);
        setShow(true);
    }

    return (
        <>

            <MainNavbar activeTab="/products"/>
            <div className="container section product">
                <div className="row">
                    <div className="col-12 col-sm-4">
                        <ProductNavbar activeTab="HH"/>
                    </div>


                    <div className="col-12 col-sm-8">

                        <div className="side-title">
                            <h5>{header}</h5>
                            <hr></hr>
                        </div>

                        <div className="row itemContainer">
                            {productList}
                        </div>


                        <div>
                            {show ? (
                                <ItemModal handleCallBack={callBack} name={name} image={image} description={description} packSize={packSize} productOf={productOf} exclusiveAvailability={exclusiveAvailability} ingredients={ingredients} dosageInstructions={dosageInstructions}/>
                            ) : (
                                ""
                            )}
                        </div>

                    </div>
                </div>
            </div>






        </>
    );
}

export default HeartHealth;
